import {Container} from "reactstrap";
import {Row, Col} from "reactstrap";


import './Main.css';


import image1 from "./img/1.jpg";
import image2 from "./image/LWL_Campus_2020.jpg";
import image3 from "./image/LWL_Campus_2020.jpg";





const Main = () => (
    <Container>
        <Row>
            <Col>.col</Col>
        </Row>
        <Row>
            <Col>.col</Col>
            <Col>.col</Col>
            <Col>.col</Col>
            <Col>.col</Col>
        </Row>


    </Container>

);

export default Main;
